import Header from './Header'

const layoutStyle = {
  margin: 20,
  padding: 20,
  border: '1px solid #DDD'
}

   const aside = {
    background: f0f0f0,
    padding: 10,
    width: 200,
       }
  
 
   
   
export default function Layout (props) {
  return (
    <div>
        <aside>
         <Header />
         </aside>
         <p>
           {props.children}
           </p>
    </div>
  )
}
